INSERT INTO `actors` (`actor_id`, `name`, `content`, `image`) VALUES
(1, '馬東石', '1971年於首爾出生，1990年赴笈美國哥倫布州立社區學院留學，就讀體育系，因而英語十分流利。畢業後續定居當地，曾任美國職業摔跤運動員馬克·科爾曼的私人教練。2000年正式入籍並搬家到洛杉磯，但因電影專業的弟弟而對電影產生興趣，開始參加試鏡。2002年為圓演員夢而回流韓國，開展其演藝生涯。', 'actor1.jpg'),
(2, '孫錫久', '韓國男演員。在美國和加拿大完成學業，故説得一口流利英語。2005年，正在服義務兵役的孫錫久自願派遣駐伊拉克的宰桐部隊服役。廣為人知的角色是Netflix美劇《超感8人組第二季》，和裴斗娜演出對手戲。', 'actor2.jpg'),
(3, '伊莉莎白·翠絲·歐森', '伊莉莎白 ·歐森1989年出生在美國加利福尼亞州洛杉磯。父親為銀行家，母親為前芭蕾舞者，家有5名兄弟姐妹，她排行第四。著名雙胞胎姐妹演員：瑪麗-凱特·歐森、艾希莉·歐森為其親姊姊們。歐森還有一個哥哥和兩個同父異母的弟弟妹妹。1996年，她的父母離婚，歐森家族有挪威和英國血統。', 'actor3.jpg'),
(4, '霍奇爾·戈梅茲', '是一名墨西哥裔美國女演員，知名於Netflix喜劇影集《保姆俱樂部（英語：The Baby-Sitters Club (2020 TV series)）》（2020年）中主演潼恩·雪佛（Dawn Schafer），以及在漫威電影宇宙電影《奇異博士2：失控多重宇宙》（2022年）中主演艾美莉卡·查韋斯', 'actor4.jpg'),
(5, '班奈狄克·康柏拜區', '班奈狄克·提摩西·卡爾頓·康柏拜區在大學畢業後，於2001年展開個人演藝生涯，由於演員的收入並不穩定，所以康柏拜區的父母一直反對他跟從兩親的道路從事演藝事業。康柏拜區也曾打算以律師作為自己的職業。不過其後有不少律師告訴他，律師的生活也不太穩定，而且也很辛苦，跟從事演藝事業很相似。兩相權衡下，康柏拜區最後選擇成為演員。康柏拜區在大學時演出舞台劇《莫札特之死》（Amadeus），擔任薩里埃利（Antonio Salieri）一角，其演出受到父親的激賞，並認為康柏拜區的表現比自己過去、甚至是將來都還要出色，因而大力支持他的演藝事業(You\'re better than I ever was, or will be. You\'ll have a good time doing this. I\'m going to support you)。', 'actor5.jpg'),
(6, '派崔克·史都華', '派崔克·史都華爵士，OBE（Sir Patrick Stewart，1940年7月13日－），英國男演員，涉獵舞台製作、電視、電影和電子遊戲多個領域。他曾獲得羅蘭士·奧利花獎、托尼獎、金球獎、艾美獎、演員工會獎和土星獎多項提名。在將近50年的職業生涯中，史都華在戲劇事業中享有盛譽，他飾演過許多莎士比亞筆下的角色。不過，也許他最為世人所知的角色是在《銀河飛龍》中飾演的星艦企業號的尚-路克·畢凱艦長，以及在「X戰警系列電影」中飾演的X教授。', 'actor6.jpg'),
(7, '楊紫瓊', '楊紫瓊1962年生於霹靂怡保一個富裕家庭，從小受到良好教育，15歲時到英國主修芭蕾舞，擁有英國皇家舞蹈學院戲劇舞蹈專業學士學位。17歲時因疏於熱身練習，擔心被老師責備，又強行苦練舞蹈時導致脊椎受傷，不得不終止舞蹈生涯。楊紫瓊在媽媽的鼓勵下，在1983年參加「馬來西亞小姐」選美競賽奪下冠軍寶座，她也代表馬來西亞出征世界小姐，進入演藝圈開始往後的銀幕生涯。', 'actor7.jpg'),
(8, '湯姆·克魯斯', '全名湯瑪斯·克魯斯·馬波瑟四世（英語：Thomas Cruise Mapother IV），是知名美國籍男演員及電影製片人。1986年主演電影《捍衛戰士》，飾演美國海軍F-14戰鬥機駕駛員，成為全美家喻戶曉的青少年偶像。1988年主演電影《雨人》，和1989年電影《七月四日誕生》，1996年起接演《不可能的任務》系列電影代表作，成為風靡全球的好萊塢電影巨星。2022年榮獲第75屆坎城影展榮譽金棕櫚獎。', 'actor8.jpg'),
(9, '方·基墨', '是一名美國男演員。出生於加州洛杉磯市，好萊塢專業學校（英語：Hollywood Professional School）（Hollywood Professional School）畢業，17歲時以當時最年輕的錄取者進入茱莉亞音樂學院戲劇系就讀，曾因演出莎士比亞名劇《王子復仇記》而得獎。1986年因參與電影《捍衛戰士》（Top Gun）一片的演出而在電影界漸露頭角，代表作包括《永遠的蝙蝠俠》（Batman Forever，1995年）、《神鬼至尊》（The Saint，1997年）等片。', 'actor9.jpg'),
(10, '珍妮佛·康納莉', '美國女演員，奧斯卡獎得主。十幾歲起即在電影產業工作，並且因為參加《魔王迷宮》（Labyrinth）和《神采飛揚》（Career Opportunities）等電影的演出而獲得知名度，但一直到2000年演出《噩夢輓歌》和2001年的傳記電影《美麗境界》獲得奧斯卡最佳女配角獎後演技才獲得大眾認同。', 'actor10.jpg'),
(11, '邁茲·米克森', '一位丹麥男演員。他憑藉在2012年電影《謊言的烙印》中的演出奪得第65屆坎城影展最佳男演員獎。以2020年《醉好的時光》贏得歐洲電影獎最佳男主角。', 'actor11.jpg'),
(12, '艾迪·瑞德曼', '他於2000年代早期開展他的銀幕事業，開始時他參與電視劇與電影的演出，其首部作品是《心智相投（英語：Like Minds）》。2010年，他繼續在劇院演出，於百老匯的劇目《紅》最受注目，因此他獲得東尼獎的最佳劇場表現男配角。期後他於2014年由詹姆士·馬許執導的傳記電影《愛的萬物論》中飾演史蒂芬·霍金，其演出備受肯定，並贏得金球獎、英國電影學院獎、美國演員工會獎，以及第87屆奧斯卡金像獎最佳男主角。', 'actor12.jpg'),
(13, '中谷美紀', '1993年，中谷以電視劇《一個屋簷下》出道，1996年，發行個人首支單曲〈MIND CIRCUS〉。1999年，初主演電視劇《繼續》，在劇中飾演呆傻的天才女刑事「柴田純」一角而大受歡迎，成為個人代表作，演技受到肯定。2000年，和渡部篤郎、椎名桔平共同演出天童荒太原著小說改編的連續劇《永遠的仔（日語：永遠の仔）》，細膩演繹亦獲好評。', 'actor13.jpg'),
(14, '田中圭', '田中畢業於千葉縣頂尖的升學學校—澀谷教育學園幕張國中‧高中。國中三年級時在母親的推薦下參加了在《Audition》雜誌上刊登的「21世紀電影明星徵選」，一路過關斬將到了最終選拔，雖然沒能入選，不過也因此被現在的經紀公司發現而進了演藝圈。', 'actor14.jpg'),
(15, '松井愛莉', '2009年1月，參加青少年雜誌《nicola》的模特兒甄選比賽，在14076名參賽者中獲得大獎。同年10月，成為nicola雜誌的專屬模特。2011年1月首次在雜誌封面出現。2012年2月首次單獨成為封面人物（2012年3月號），成為繼古畑星夏、池田依來沙以後同年齡模特中第三個單獨成為封面人物的模特。\n\n2010年4月，成為櫻花學院學員。2012年3月15日從櫻花學院畢業。', 'actor15.jpg'),
(16, '高橋文哉', '高橋文哉於2017年6月參加「男子高校生ミスターコン2017」選拔。12月24日，他入圍了1000萬名候選人之一。\n\n2018年7月29日至10月14日間，他參與了真人秀節目《別被太陽與狼君所欺騙》的錄影，使人氣大幅上升。\n\n2019年7月，高橋文哉被選為東映特攝電視劇《假面騎士ZERO-ONE》的主角，他在劇中飾演飛電或人／假面騎士ZERO-ONE，這也是他首度擔綱主演的作品。該劇於2019年9月1日開播。在此前，他也在2019年7月26日上映的電影《劇場版 假面騎士ZI-O Over Quartzer》中先行登場。', 'actor16.jpg'),
(17, '尼可拉斯·凱吉', '美國男演員和製片人。義大利裔美國人，生於加州長灘，其叔父為著名導演法蘭西斯·科波拉，姑母為泰莉亞·雪爾。17歲進入電影行業，為免於叔父光環的陰影下工作，改姓「凱吉」。1996年憑藉《遠離賭城》中扮演的酒鬼一角奪得當年度奧斯卡最佳男主角獎。而他近年來所選擇的角色則受到許多強烈的批評。直到2013年，他主演的《古魯家族》（配音）和《絕地重生》才獲得普遍好評。', 'actor17.jpg'),
(18, '貝德羅·帕斯卡', '智利裔美國男演員。他最著名的是在HBO電視劇《冰與火之歌：權力遊戲》（2014年）第四季中所飾演的奧柏倫·馬泰爾（英語：Oberyn Martell），以及在Netflix原創電視劇《毒梟》（2015年至2017年）中飾演的哈維爾·潘納一角。', 'actor18.jpg'),
(19, '艾米利奧·艾斯特維茲', '美國的演員、導演以及作家。他是演員出身，曾是1980年代「Brat Pack」的一員，主演過《早餐俱樂部》、《St. Elmo\'s Fire》，還曾在1983年的熱門電影《The Outsiders》中主演。他的其他知名作品還包括《Repo Man》、《The Mighty Ducks》以及其續集、《Stakeout》、《Maximum Overdrive》、《Bobby》（也兼任編劇、導演），以及包括《Young Guns》與其續集在內的西部片。', 'actor19.jpg'),
(20, '吉娜·瑪隆', '美國女演員和音樂家。瑪隆在《來自卡羅萊納的私生女》（1996年）中的演出成為了她的電影處女作。後來她又出演了多部著名電影，如《艾倫福斯特》（1997年）、《接觸未來》（1997年）、《親親小媽》（1998年）、《怵目驚魂28天》（2001年）、《神啊！救救我吧！》（2004年）、《傲慢與偏見》（2005年）、《阿拉斯加之死》（2007年）、《禁入廢墟》（2008年）、《殺客同萌》（2011年）和「飢餓遊戲系列電影」（2013年至2015年）。', 'actor20.jpg');
