INSERT INTO `movies` (`movie_id`, `name_EN`, `name_CN`, `content`, `duration`, `type`, `image`, `mp4`, `listing_date`, `strong`) VALUES
(1, 'THE ROUNDUP', '犯罪都市2', '掃蕩加里峰洞任務後過了4年，衿川刑警隊前往越南引渡逃走的嫌犯。「怪物刑警」馬錫道（馬東石 飾）和全日萬組長（崔貴化 飾）發現在當地的嫌犯十分可疑，得知其背後有個凶惡殘暴的主使者姜海相（孫錫求 飾）。馬錫道和衿川刑警隊奔走於韓國和越南兩地，開始緝捕史上最壞的傢伙姜海相……', '1時46分', '動作', 'movie1.jpg', 'movie1.mp4', '2022-05-20', 0),
(2, 'Doctor Strange in the Multiverse of Madness', '奇異博士2：失控多重宇宙', '漫威宇宙進入第四階段，格局更宏大的多重宇宙，一個充滿危險，多重現實、奇異交錯的未知世界。奇異博士與信念相合的夥伴、神秘的盟友、還有敵我難分的故人，被迫闖入超乎想像的另類現實，抵抗神秘強大的對手。', '2時06分', '動作', 'movie2.jpg', 'movie2.mp4', '2022-05-04', 0),
(3, 'Everything Everywhere All at Once', '媽的多重宇宙', '55歲的美國華裔移民秀蓮 (楊紫瓊 飾) 家庭事業兩崩潰。在老爸爸 (吳漢章 飾) 生日大壽這天，除了要阻止女兒 (史蒂芬妮許 飾) 暴走出櫃、替無用丈夫 (關繼威 飾) 擦屁股，還得去稅務局向古板大嬸 (潔米李寇帝絲 飾) 解釋不太妙的稅務問題。甫踏進大樓電梯，軟爛丈夫竟搖身一變演起駭客任務，聲稱自己是另一個宇宙的版本，而艾芙琳也是千萬宇宙裡的其中一個。還來不及理解，邪惡勢力已在多元宇宙中蔓延，世界即將毀滅，只有在這他媽的宇宙裡、一無是處的艾芙琳才能拯救世界…', '2時20分', '動作', 'movie3.jpg', 'movie3.mp4', '2022-04-22', 0),
(4, 'TOP GUN: MAVERICK', '捍衛戰士：獨行俠', '故事敘述服役超過30年，身為海軍頂尖飛行員的「獨行俠」彼得米契爾上校 (湯姆克魯斯 飾) 仍舊堅守他的崗位，以試飛員的身份不斷突破飛行極限，也放棄任何足以終止飛行生涯的晉升。他在訓練一組 TOP GUN 菁英小組去執行一個前所未聞的特殊任務時，遇見了已故搭檔「呆頭鵝」尼克布雷德蕭中尉的兒子-「公雞」布雷德利布雷德蕭中尉 (麥爾斯泰勒 飾) 。在面對不確定的未來和來自過去夢靨的影響下，「獨行俠」在這個要求飛行員奉獻出最終代價的行動裡，被迫面對自己最深層的心魔。', '2時10分', '劇情', 'movie4.jpg', 'movie4.mp4', '2022-05-25', 0),
(5, 'Shark Bait', '鯊顫', '一群年輕人到墨西哥海邊渡假，開心地在沙灘上喝酒狂歡，甚至還順手從岸邊偷了兩艘水上摩托車出海玩樂，卻因為玩過頭而意外相撞，導致一台沉入海中，另一台則故障無法發動，還因此讓一名友人身負重傷、命在旦夕。受困在海中央的五人，還來不及思考該如何返回陸地，就驚覺身旁竟有虎視眈眈的嗜血狂鯊，孤立無援的他們驚慌失措卻又無處可逃，僅靠著一台破損的海上摩托車，究竟該如何脫困？誰又能逃出生天？', '1時25分', '驚悚', 'movie5.jpg', 'movie5.mp4', '2022-05-13', 0),
(6, 'Jurassic World: Dominion', '侏羅紀世界：統霸天下', '今年夏天，準備體驗兩個世代的演員，首度同台演出《侏羅紀公園》電影系列史詩般的最終篇章。元老級演員蘿拉鄧恩、傑夫高布倫以及山姆尼爾，加入克里斯普瑞特與布萊絲達拉斯霍華，共同主演《侏羅紀世界：統霸天下》，這是一部故事場景橫越全球、既大膽又創意又令人看得喘不過氣來的全新冒險動作強檔鉅片。\n《侏羅紀世界：統霸天下》一片是《侏羅紀世界》電影系列統籌及導演柯林崔佛洛的全新力作，故事發生在努布拉島完全毀滅的四年之後。恐龍現在和全世界的人類共同生存，同時也在獵捕食物。這個微妙的平衡即將重新塑造未來，並且即將決定人類從此以', '2時27分', '冒險', 'movie6.jpg', 'movie6.mp4', '2022-06-08', 0),
(7, 'Fantastic Beasts: The Secrets of Dumbledore', '怪獸與鄧不利多的秘密', 'J.K.羅琳所創造的魔法世界中的最新冒險故事\n阿不思鄧不利多教授 (裘德洛 飾) 知道強大的黑巫師蓋勒葛林戴華德 (邁茲米克森 飾) 正準備控制整個魔法世界，但他也深知自己無法單獨阻止葛林戴華德，於是委託奇獸飼育學家紐特斯卡曼德 (艾迪瑞德曼 飾) 帶領一群勇敢的巫師、女巫和一位麻瓜烘焙師進行這項危險任務。他們在任務中將會遇到新舊奇獸，並與更多葛林戴華德的追隨者發生衝突，但隨著任務風險越來越高，鄧不利多還能置身事外到什麼時候呢？', '2時22分', '劇情', 'movie7.jpg', 'movie7.mp4', '2022-04-14', 0),
(8, 'The Love of Siam', '愛在暹邏', '繆與棟是從小形影不離的鄰居，同時也是同校的好友，但直到棟的姐姐在一次旅行中失蹤，自責不已的父親就開始酗酒，靠著母親蘇妮一人獨立工作支撐家庭，為了遺忘不愉快的往事，棟跟著父母搬家，與繆也就此失聯。\n幾年後，繆在學校組了一個名為August的樂團，專輯在年輕人聚集的暹邏廣場一帶賣到缺貨。而棟搬回曼谷，還帶著一位漂亮的女朋友朵娜，卻在CD店門口遇到了繆。被經紀人要求寫溫馨情歌的繆，把自己對棟的情感，寫成了一首歌，並在棟家舉辦的派對中演唱，觸動了棟的內心，終於正視自己內心情感的棟，在派對結束後吻了繆。\n只是，兩人', '2時38分', '愛情', 'movie8.jpg', 'movie8.mp4', '2022-05-20', 0),
(9, 'Ox-Head Village', '牛首村', '奏音 (Koki 飾) 發現在某個靈異影片中，有個長得和自己一模一樣的女高中生。影片中的女高中生被迫戴著牛首面具，遭監禁於一處廢墟中，影像內容就只到這裡。難以言喻的恐懼不安感驅使著奏音，她決定前往影片的拍攝地點——富山縣的坪野礦泉。在那裡，被稱為「牛首村」的毛骨悚然之地的瘋狂恐怖氣息朝她侵襲而來……', '1時55分', '驚悚', 'movie9.jpg', 'movie9.mp4', '2022-05-20', 0),
(10, 'Blue is the Warmest Color', '藍色是最溫暖的顏色', '一如時下所有十五歲的少女，阿黛兒情竇初開，卻因同儕壓力，壓抑著喜歡同性的慾望。直到遇上藍色頭髮的艾瑪，她的世界徹底改變，那命定般強大的吸引力，熾烈燃燒著的愛與慾，佔據了兩個人的身心靈。然而成長環境、社會階層、認知興趣等等現實差異，卻悄悄地在看似完美的兩人世界裡，埋下了不安的因子……\n改編自茱莉瑪侯的短篇漫畫，導演阿布戴柯西胥延續其獨特風格，注入社會觀察，將一段女女之愛賦予了更深厚的樣貌。隨著大量特寫、精彩的場面調度，在一場場極具張力的戲之間，貼近直視阿黛兒的生活與內心，與她共享那些美麗或心碎的時刻。兩位女', '2時59分', '愛情', 'movie10.jpg', 'movie10.mp4', '2022-05-27', 0),
(11, 'PEE NAK 3', '淒厲人僧：卡到陰', '泰國郊外的古廟有個可怕的詛咒。年輕盜墓者歐弟，在古廟挖出一條二戰時期的黃金腳鍊，佔為己有的他因此觸犯詛咒，身體肌膚變成蛇鱗，強大的詛咒讓他十分痛苦，也再次召喚出古墓厲鬼。在與尋求復仇的惡鬼時間賽跑中，因詛咒纏身快死的阿弟，與狐群狗黨噗嚨共好友們，布倫、阿一、都敏俊，以及潘潘，將遠赴泰國東北湄公河一座傳說中的雨林古寺，尋找破解詛咒的秘密。', '1時51分', '驚悚', 'movie11.jpg', 'movie11.mp4', '2022-05-20', 0),
(12, 'The Twin', '鬼雙胞', '一場悲劇性的事故，奪走了雙胞胎之一的寶貴生命，也讓瑞秋 (泰瑞莎帕瑪 飾) 和丈夫安東尼 (史蒂文克瑞 飾) ，帶著倖存的兒子艾略特 (崔斯坦羅傑里 飾) ，從美國搬到世界的另一端，期望展開嶄新人生。他們起初在寧靜的鄉村進行康復治療，很快卻發生不祥的惡兆。艾略特竟在此時告訴瑞秋，原本已經死去的兄弟，正在糾纏著他…。瑞秋能否找出讓艾略特痛苦的原因，並試圖去對抗這股邪惡的力量呢？', '1時48分', '驚悚', 'movie12.jpg', 'movie12.mp4', '2022-05-20', 0),
(13, 'Hatching', '孵魔', '年輕的體操選手蒂雅有一個人人稱羨的家庭，她的母親打扮得光鮮亮麗，在社群上維繫著完美家庭的形象；她的父親西裝筆挺，溫柔體面；弟弟更是乖巧懂事。看似毫無瑕疵，充滿溫暖的家庭，卻因為誤闖客廳的烏鴉全亂了套。沒想到，崩毀的節奏不止於此，蒂雅在森林裡意外發現一顆神秘的蛋，她偷偷地將蛋藏起來，對它悉心照料。蛋以飛快的速度生長，眼看著即將孵化，裡頭孕育的駭人生物卻遠超蒂雅的想像⋯⋯', '1時27分', '驚悚', 'movie13.jpg', 'movie13.mp4', '2022-05-20', 0),
(14, 'The Public', '公共圖書館員', '寒冬將至，一股異常刺骨的北極寒風吹襲美國俄亥俄州的西南部城市辛辛那提。城市中為每個人平等開放的公共圖書館，成了無家可歸的人們與街頭流浪者短暫禦寒的所在。原本公共圖書館的館長默許這種行為。但在那個異常極端的夜裡，圖書館館長的心境也有了轉變…。\n本因只是一群街友短暫需要一個避寒的去處，卻陰錯陽差演變為佔領圖書館的公民運動。隨著警方的介入調查，加上媒體推波助瀾的放送，在各方湊熱鬧的鄉民七嘴八舌的熱議加大了運動的聲量，卻似乎讓在公共圖書館裡的遊民們成為更孤立的存在。', '1時59分', '劇情', 'movie14.jpg', 'movie14.mp4', '2022-05-20', 0),
(15, 'First Gentleman', '第一人夫', '愛鳥成痴的相馬 (田中圭 飾) 是個鳥類學家，某天出差回來後發現才貌雙全的愛妻凜子 (中谷美紀 飾) 當選了日本首相，一夜之間平凡的婚姻生活有了巨大轉變。作為日本史上首位「第一人夫」的相馬想全力支持妻子，但面對首相部下的監控、媒體的追擊，使他無法像過去一樣自由。究竟相馬該如何面對未來？夫妻之間又會面臨什麼挑戰呢？', '2時02分', '劇情', 'movie15.jpg', 'movie15.mp4', '2022-05-20', 0),
(16, 'An Autumn\'s Tale', '秋天的童話', '青春洋溢的年輕女孩李琪 (鍾楚紅 飾) 為了遠距離戀愛的男友文森 (陳百強 飾)，隻身遠赴紐約讀書，家人安排在唐人街打工的船頭尺 (周潤發 飾) 幫忙打點住處，李琪滿心期待展開全新生活，卻發現原來男友已經移情別戀，讓她徹底心碎，整天足不出戶，某日竟然險些吸入過量的煤氣，幸好住在樓下的船頭尺及早發現才沒釀成憾事。在船頭尺的悉心照顧下，李琪重拾自信，開始專心讀書和工作，兩人成為彼此的支柱，關係也變得曖昧起來…', '1時40分', '劇情', 'movie16.jpg', 'movie16.mp4', '2022-05-13', 0),
(17, 'The Deer King', '鹿王', '「戰士隊」獨角的首領凡恩在戰爭中敗北，淪為奴隸被囚禁在地下鹽礦，某天晚上，一群神秘的山犬襲擊鹽礦，礦坑裡的人皆一一死去，活下來的只有凡恩與小女孩悠娜，幸運存活下來的兩人，為了逃避追捕而開始逃亡。\n天才醫師赫薩爾奉命調查地下鹽礦的死亡真相，發現死去的人感染的似乎是絕跡已久的黑狼熱，但為什麼只有凡恩跟悠娜活下來呢？赫薩爾在調查的過程中，逐漸發現隱藏在疾病背後的巨大陰謀…', '1時53分', '冒險', 'movie17.jpg', 'movie17.mp4', '2022-05-13', 0),
(18, 'The Unbearable Weight of Massive Talent', '超吉任務', '破產的好萊塢巨星尼可拉斯凱吉 (尼可拉斯凱吉 飾) 希望能演出昆汀塔倫提諾的下一部電影，為了擺脫沉重的債務，他答應收下一百萬美元的酬勞，出席墨西哥億萬富翁粉絲哈維 (佩德羅帕斯卡 飾) 的生日派對。當他得知哈維是綁架總統女兒的大毒梟時，情況開始變得複雜，中情局希望凱吉能協助他們將哈維逮捕到案，於是他被迫展現出他過去在大銀幕上的英雄形象，以拯救自己和妻兒……。', '1時47分', '動作', 'movie18.jpg', 'movie18.mp4', '2022-04-22', 0),
(19, 'Elvis', '如果30歲還是處男，似乎就能成為魔法師', '職場戀愛順利地進行著，正沉浸在幸福的每一天時，安達突然收到了調職通知。雖然是可以挑戰自己想做的事情的大好機會，卻必須調職到距離1,200公里遠的長崎分公司。因為調職這件事，為了彼此著想的安達與黑澤，兩人的思緒開始交錯。談起遠距離戀愛的他們，也開始考慮起兩個人的未來…。究竟這場戀情會如何發展？', '1時44分', '愛情', 'movie19.jpg', 'movie19.mp4', '2022-04-08', 0),
(20, 'A Bookshop in Paris', '愛在書店相遇時', '一段意外邂逅，拯救三顆受傷的心...\n一位住在巴黎的古董書商文森，他的生活圍繞著他對書本的熱愛，但他努力經營書店的主要原因，便是悉心照料因為一場意外不良於行、甚至罹患失語症的女兒艾波。希望能透過每天與女兒分享書中的世界，也許會有奇蹟發生。\n有一天巴黎突然遇上一場傾盆大雨，一位淋了一身濕但依舊充滿活力、年輕貌美的女演員尤蘭達闖進了書店，她的唐突、熱情與笑容點亮了文森原本一成不變的生活，看著爸爸似乎找到了另一個生活重心，艾波也意識到自己的內心也悄悄有了改變...', '1時38分', '愛情', 'movie20.jpg', 'movie20.mp4', '2022-06-02', 0),
(21, 'Morbius', '魔比斯', '漫威漫畫旗下角色吸血鬼魔比斯的故事所改編! 奧斯卡得主\"賈瑞里托 \"主演！故事描述一位患有罕見血液疾病的生物化學博士魔比斯（賈瑞里托 飾演），為了治療自己和擁有相同絕症的人，不惜以自己的身體作為實驗的賭注。起初看起來很成功，魔比斯的速度與力量大幅進化，同時還擁有回聲定位能力，但沒想到有股黑暗的力量也從身體裡被釋放出來，魔比斯究竟是會擊退體內的邪惡，還是會臣服於這股神秘的全新力量呢？', '1時44分', '冒險', 'movie21.jpg', 'movie21.mp4', '2022-04-01', 0),
(22, 'The Lost City', '失落謎城', '一位聰慧過人卻離群索居、個性孤僻的知名作家蘿莉塔賽吉（珊卓布拉克 飾演）以創作故事發生在異國險境的暢銷愛情冒險小說為生，她筆下的男主人翁是根據一名高顏值的封面男模艾倫（查寧塔圖 飾演）來塑造，他也一直以「戴許」這個角色自居。蘿莉坦與艾倫一起宣傳她的全新小說時，竟然被一名個性古怪的億萬富豪（丹尼爾雷徳克里夫 飾演）綁架，他希望她能帶他找到她全新小說中那座失落謎城裡的大寶藏。艾倫為了想證明他不只是在小說中是個英雄，在現實生活中也一樣，就決定展開一場救援行動，企圖拯救蘿莉塔。於是這對歡喜冤家就踏上一場驚險刺激、', '1時52分', '冒險', 'movie22.jpg', 'movie22.mp4', '2022-04-08', 0),
(23, 'Popran', '急急復雞雞', '東京市中心。一道又一道的黑影高速閃過湛藍的天空。新聞台開始強力輪播「東京上空出現飛魚！？」的電視特輯，似乎出現了一個全新的都市傳說。 田上晃（皆川暢二 飾演）是網漫公司的老闆，20多歲和朋友來東京創業，事業獲得成功，但他身邊沒有朋友和家人，白天打拚事業，晚上就找陌生女人一夜情。 某天早上，田上在一夜情後，驚覺GG竟然不見了。他急忙找醫生檢查治療，但醫生看不出異狀，束手無策。而他意外看到一個神秘詭異的網站「波普蘭互助會」，發現竟然不只是他一個人的下體失蹤了。 波普蘭的會長告訴他們，GG有了自己的意識，靠著睪', '1時48分', '劇情', 'movie23.jpg', 'movie23.mp4', '2022-04-22', 0),
(24, 'Superheroes', '真愛超能力', '安娜(潔思敏婷卡 飾演)是個前衛的漫畫家，仇視一切傳統事物；馬可(亞歷山卓柏爾吉 飾演)則是個保守的物理學教授，深信一切現象的背後皆有成因。當這兩個人相遇在一起，卻成就了一段難以解釋、無法預知的愛情…。安娜和馬可巧遇在一個雨夜裡，並莫名地看對了眼。怎奈相愛容易相處難，率性難搞的漫畫家安娜，成天忙著以畫筆勾勒一對有超能力的愛侶；信仰萬物有道的物理學教授馬可，則整日忙著計算雨滴如何從天而落…。他們彷彿遊走在兩個平行時空，卻因為這段愛情，辯證巧合與命定，對話未來與過去，經驗了同樣的焦慮、嫉妒與無常。但要用一輩子', '2時27分', '愛情', 'movie24.jpg', 'movie24.mp4', '2022-04-01', 0),
(25, 'Mole Song - FINAL', '臥底型警FINAL', '自警校創立以來最低分畢業、反省書數量卻是第一，貪戀美色卻熱血的警察菊川玲二(生田斗真 飾演)，某天突然派至黑道臥底！！經過長年的臥底生活，玲二終於贏來最後的任務──阻止交易額6000億日圓走私交易！本次的舞台是「海上樂園」豪華郵輪！面對最強的敵人─烈雄以及來自魔性美女‧沙門的誘惑、戀人‧純奈的修羅場…玲二是否能達成臥底任務，將轟周寶等人一舉逮捕，成為臥底之王並全身而退？而玲二與不死蝶的關係又會是如何！', '2時02分', '冒險', 'movie25.jpg', 'movie25.mp4', '2022-04-22', 0),
(26, 'In The Wake', '那些得不到保護的人', '在東日本大地震發生後十年，仙台地區發生連續殺人事件，兩位官員被緊緊束縛並活活餓死，死狀悽慘。這種彷彿在懲罰被害者的犯罪行為，立刻引起警方的高度重視。刑警笘篠誠一郎(阿部寛 飾演)與蓮田智彥(林遣都 飾演)從兩名被害者身上找出共同點，並鎖定剛出獄的縱火犯──利根泰久(佐藤健 飾演)。在笘篠試圖釐清真相的過程中，也結識了保護一課的基層人員圓山幹子(清原果耶 飾演)，發掘出不為人知，更深不可測的黑暗。當生命界線與貧窮富貴畫上等號，誰是生命的仲裁者？誰又是得不到保護的人？', '1時40分', '動作', 'movie26.jpg', 'movie26.mp4', '2022-04-08', 0),
(27, 'Baragaki: Unbroken Samurai', '燃燒的劍', '日本歷史巨擘司馬遼太郎暢銷超過500萬冊磅礡鉅作改編！幕末動亂時期，新選組副長土方歲三（岡田准一 飾演），他出身自武州石田村農家，是眾人眼中的棘手份子。他發揮好勇鬥狠的性格，以及天生的組織能力，加上堅強的信念與超凡魅力，讓他將浪士與平民集結而成的新選組，打造成當時最強大的武裝集團，也成為最令敵手與同袍畏懼的男人，並在這風起雲湧的時代中，為日本歷史掀起意外的滔天巨浪…。', '2時22分', '動作', 'movie27.jpg', 'movie27.mp4', '2022-04-29', 0),
(28, 'Life For Sale', '售命', '二十七歲的厭世保險員阿良（傅孟柏 飾演）一天到晚都在想要怎麼死，生命對他而言只是不停重複跳針，直到某天撿到日本文豪三島由紀夫的遺作《性命出售》才想通….就算要關門大吉，也應該先來個清倉大拍賣！可是沒想到這條命在網上竟然乏人問津，就在他心灰意冷之際，阿良得知鄰居陳瑜真（曾之喬 飾演）的兒子命在旦夕需要心臟移植，正當他猶豫是否捐出心臟時，一位美豔女總裁沈晶（蔡淑臻 飾演）開出天價要買阿良的命做人體實驗，同時又冒出一位黑道老大派出殺手鬼臂（李銘忠 飾演）綁架了他父母威脅他賣命。阿良沒萬萬沒料到他一文不值的生命，', '1時59分', '驚悚', 'movie28.jpg', 'movie28.mp4', '2022-04-29', 0),
(29, 'Fortune Favors Lady Nikuko', '漁港的肉子', '聰明可愛又有點早熟的11歲小女孩喜久子（Cocomi 配音），與她開朗樂天、吃得胖嘟嘟的母親肉子（大竹忍 配音）雖然整天都在鬥嘴，但是彼此卻又貼心地關心對方。外表與個性截然不同的母女，因故落腳在鄉下小漁港的一艘漁船上，這裡的生活原本是愜意單純，喜久子上學的日常和肉子在居酒屋開心的上班，加上喜久子與班上的怪咖同學二宮（花江夏樹 配音），兩人有著不同於一班同學的情誼。但是因為一場意外，卻讓喜久子發現了驚人的秘密……', '1時25分', '愛情', 'movie29.jpg', 'movie29.mp4', '2022-05-13', 0),
(30, 'Sonic the Hedgehog 2', '音速小子2', '音速小子索尼克在綠丘鎮安頓下來之後，他就急著要證明自己有能力成為一名真正的英雄。當蛋頭博士(金凱瑞 飾演)帶著全新的搭檔納克魯斯(伊卓瑞斯艾巴 配音)，又回來尋找一塊力量強大足以毀滅人類文明的翡翠的時候，他就面對了另一個嚴峻的考驗。 這次索尼克和他自己的跟班塔爾斯攜手合作，一起踏上一場環遊世界的冒險旅程，希望能在那塊翡翠落入壞人手中之前先找到它。', '1時27分', '冒險', 'movie30.jpg', 'movie30.mp4', '2022-04-01', 0);
