INSERT INTO `news` (`news_id`, `title`, `content`, `image`) VALUES
(1, '【雷神索爾：愛與雷霆】訂票抽獎活動', '使用LuckyDog看電影APP 訂購【雷神索爾：愛與雷霆】電影票抽電影主題贈品', 'news1'),
(2, '【貓王艾維斯】票價調整公告', '【貓王艾維斯】因片長超過2小時30分，現場票價以及銀行優惠票價皆調整10元，套票價格不變 並依現場公告為準。', 'news2'),
(3, '「臺灣社交距離App」宣導', '指揮中心鼓勵全民下載使用「臺灣社交距離App」，確保社區民眾安全，並將於衛生福利部疾病管制署官方臉書專頁「疾病管制署─1922防疫達人」辦理抽獎活動。另下載使用者若為確診病例且願意上傳去識別化接觸資料，將給予協助疫調獎勵金每人5,000元。相關抽獎活動辦法可至「疾病管制署-1922防疫達人」臉書專頁瀏覽。', 'news3'),
(4, '因應政府防疫規定 出入電影場所應佩戴口罩', '因應政府防疫規定，出入電影場所應佩戴口罩，未佩戴且勸導不聽者，由地方政府裁罰新臺幣3千元至1萬5千元以下罰鍰，感謝您的支持與配合！', 'news4');
